#! /bin/sh
# Evaluate performance of concatenating strings.

if [ $# -lt 1 ]; then
  set ksh dash bash zsh
fi

while [ $# -gt 0 ]; do
  echo "\n$1: 2^5 chars <> 2^5 chars"
  time $1 -c 'acc=0; i=0; c="aaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaa"; while [ $i -lt 1000 ]; do i=$((i+1)); acc="$c$c"; done';

  echo "\n$1: 2^5 chars <> 1 chars"
  time $1 -c 'acc=0; i=0; c="aaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaa"; while [ $i -lt 1000 ]; do i=$((i+1)); acc="${c}a"; done';

  echo "\n$1: 1 chars <> 2^5 chars"
  time $1 -c 'acc=0; i=0; c="aaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaa"; while [ $i -lt 1000 ]; do i=$((i+1)); acc="a$c"; done';

  echo "\n$1: 2^15 chars <> 2^5 chars"
  time $1 -c 'acc=0; i=0; c=""; while [ $i -lt 1000 ]; do i=$((i+1)); acc="$c$c"; done';

  echo "\n$1: 2^15 chars <> 1 chars"
  time $1 -c 'acc=0; i=0; c=""; while [ $i -lt 1000 ]; do i=$((i+1)); acc="${c}a"; done';

  echo "\n$1: 1 chars <> 2^15 chars"
  time $1 -c 'acc=0; i=0; c=""; while [ $i -lt 1000 ]; do i=$((i+1)); acc="a$c"; done';
  shift
done
